import React, { useEffect } from "react";
import Home from "./Class/ex-1";
const App = () => {
  const url = "https://jsonplaceholder.typicode.com/todos";
  const fetchData = async (url) => {
    try {
      const response = await fetch(url);
      console.log(response);
    } catch (error) {}
  };
  useEffect(() => {
    fetchData(url);
  }, []);
  return (
    <>
      <Home />
    </>
  );
};
export default App;
